import {useState} from 'react';
import "./App.css";
import Header from './components/header-components/Header';
import Navbar from './components/navbar-components/Navbar';
import TeamsPP from './components/PrimaryPage/TeamsPP';
import ChatsPP from './components/PrimaryPage/ChatsPP';
import SettingsDropList from './components/droplist-components/SettingsDropList';
function App() {

  const [openSettings,setOpenSettings]= useState(false)
  return (
    <div className="App">
      <Header openSettingsHandler={setOpenSettings}/>
      {openSettings && <SettingsDropList/>}
      <div className="Body">
        <Navbar/>
        <TeamsPP/>
      </div>  
    </div>
  );
}

export default App;
